import './App.css';
import Projects from './Projects';
import AboutMe from './AboutMe';
import MazeGame from './MazeGame';
import MySkills from './MySkills'
import Marketplace from './MockTradingPlatform';

import space from './images/space.jpg'
import cool from './images/neatbg.png'
import { Parallax, ParallaxLayer } from '@react-spring/parallax';

import Typewriter from "typewriter-effect";
import React, { useEffect, useRef, useState } from 'react';
import { useInView} from '@react-spring/web';

import Transition from './InterPageTransition';

function App() {
  const ref = useRef();

  return (
    <div>
      <Parallax pages={7} ref={ref}>
        <ParallaxLayer
          offset={0}
          speed={1}
          factor={1}
          onClick={()=> ref.current.scrollTo(1)}
          style={{
            backgroundImage: `url(${space})`,
            backgroundSize: 'cover'
          }}
        ></ParallaxLayer>

        <ParallaxLayer
          offset={1}
          speed={1}
          factor={1}
          onClick={()=> ref.current.scrollTo(2)}
          style={{
            backgroundImage: `url(${cool})`,
            backgroundSize: 'cover'
          }}
        ></ParallaxLayer>

        <ParallaxLayer
          offset={0.2}
          speed={0.05}
          onClick={()=> ref.current.scrollTo(1)}
        >
          <div className="App">
              <Typewriter
                options={{
                  loop: true,
                }}
                onInit={(typewriter) => {
                  typewriter.typeString("Hi, I'm Nemanja!").pauseFor(2000).start();
                }}
              />
          </div>
        </ParallaxLayer>

        <ParallaxLayer
          offset={1.2}
          speed={0.05}
          onClick={()=> ref.current.scrollTo(2)}
        >
          <div className="App">
            <Typewriter
              options={{
                loop: true,
              }}
              onInit={(typewriter) => {
              typewriter.typeString("And this is my website!").pauseFor(2000).start();
            }}/>
          </div>
        </ParallaxLayer>

        <ParallaxLayer
          offset={2}
          speed={1}
          factor={1}
          onClick={()=> ref.current.scrollTo(3)}
        >
          <Projects/>
        </ParallaxLayer>

        <Transition />
        <p>Hello</p>

        <ParallaxLayer
          offset={3}
          speed={1}
          factor={1}
        >
          <MazeGame />
        </ParallaxLayer> 

        <ParallaxLayer
        offset={4}
        speed={1}
        factor={1}
        >
          <Marketplace/>
        </ParallaxLayer>

        <ParallaxLayer
        offset={5}
        speed={1}
        factor={1}
        >
          <MySkills/>
        </ParallaxLayer>

        <ParallaxLayer
        offset={6}
        speed={1}
        factor={1}
        >
          <AboutMe/>
        </ParallaxLayer>
      </Parallax>
    </div>
  );
}

export default App;
